import React, { FunctionComponent, useEffect, useState } from 'react';
import TextField from '@material-ui/core/TextField';
import CSS from 'csstype';
import {get_library} from '../services/http-requests'
import { Container , Row, Col } from 'react-bootstrap';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import { Theme, createStyles, makeStyles } from '@material-ui/core/styles';
import ReactPlayer from "react-player"
import type {Video} from '../pages/library'
type Props = {
  title: string,
  id: string
}

export const VideoPlayer: FunctionComponent<Video> = ({title, id}: Props)=> {
  const [vId, setVId]= useState(id)
  const [vTitle, setVTitle]= useState(title)
  return <>
  <div style={containerStyle}>
  <div>
    <h2> {vTitle}</h2>
      <ReactPlayer
        url="https://www.youtube.com/watch?v=${vId}"
      />
    </div>
  </div>
  </>
}



const containerStyle: CSS.Properties = {
  display: 'flex',
  justifyContent: 'center',
};

const boxStyle: CSS.Properties = {
  backgroundColor: 'bisque'
};
